	"sapmarco/projectpages/i18n/i18n_en.properties":'title=projectpages\nappTitle=projectpages\nappDescription=App Description\nsectionSkills=What am I working with?\nroughOverview=- Rough Overview -\nVersionname=Projectname: \nUI5Ver=Version: \nfooterText=I\'m just a little demo project, don\'t hurt me. Kill me. Now.\nthemeToggleTooltip=Toggle Theme\nversionInfoTooltip=Check Version\nUI5VerDlgTitle=Version Information (package.json)\nUI5VerDlgClose=Close\nwiki=Wiki/Blog\nwikiButtonHeader=Wiki\nwikiButtonSubtitle=Check it out!\nsidebar=Navigation\nsource=View on Github\nsourceTooltip=Wiki\nsourceEdit=Edit\nsourceTooltipEdit=Edit this article\nintroText=Dedicated ABAP developer that also takes great interest in exploring things beyond my known field of work.\nmainText=Hey there! My name is Marco and this is a demo page where I practice a few UI5/Web Development specific things. It has a bit of information about me here and there. To learn more just follow me on one of the socials linked above. \\n Any feedback is very much appreciated as I\'m not a UI5 developer in my current working position but mostly learn about it in my spare time. There are other topics like CAP (Cloud in general), CDS, OData and so on, that also highly interest me. \\n\\n A Short description of myself would be: \'Jack of all trades, master of none\'.',
